import React, { useState } from "react";

const Profile=()=>{
    const [name,setName]= useState(null);
    const [email,setEmail]= useState(null);
React.useEffect(() => {
    fetch("/getuser")
      .then((res) => res.json())
      .then((data) => {
          setName(data.username);
          setEmail(data.email);
      });
  }, []);

}
export default Profile;
